import React from 'react';
import './styles.css';
import ProjectCard from '../components/project-cards';
import Reddit0 from '../assets/reddit0.png';
import Reddit1 from '../assets/reddit1.png';
import Reddit2 from '../assets/reddit2.png';
import Reddit3 from '../assets/reddit3.png';

export default function Projects() {
    const redditProjectPictures = [Reddit0, Reddit1, Reddit2, Reddit3];
    return (
        <div className="Body">
            <h1>Projects</h1>

            <ProjectCard images={redditProjectPictures} />
        </div>
    )
}
